import { useState } from "react";

function App() {
  const giClosedGuard = [{ name: "Kimura" }];
  const [giOpen, setGiOpen] = useState(false);
  const [noGiOpen, setNoGiOpen] = useState(false);
  return (
    <>
      <div>
        <button onClick={() => setGiOpen((o) => !o)}>Gi</button>
        {giOpen && (
          <iframe
            width="560"
            height="315"
            src="https://www.youtube.com/embed/p-6lmaseoGI?si=I8if2jxF1rFLtoO4"
            title="YouTube video player"
            frameborder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share"
            referrerpolicy="strict-origin-when-cross-origin"
            allowfullscreen
          ></iframe>
        )}
      </div>
      <div>
        <button onClick={() => setNoGiOpen((o) => !o)}>No gi</button>
        {noGiOpen && <h1>no gi</h1>}
      </div>
    </>
  );
}

export default App;
